# 76. Minimum Window Substring
# difficulty: hard
# https://leetcode.com/problems/minimum-window-substring/

import pytest


class Solution:
    def minWindow(self, s: str, t: str) -> str:
        return min_window(s, t)


def min_window(s, t):
    """NOTE: This produces a correct output, but embarassingly slow. Need to
    think of a faster solution.

        Runtime: 668 ms, faster than 6.30% of Python3 online submissions for
        Minimum Window Substring.
    """
    n = len(s)
    left, right = 0, 0
    min_left, min_right = 0, 0
    min_window_size = n + 1
    letter_count = {**{w: 0 for w in s}, **{w: 0 for w in t}}

    # TODO: Consider code refactoring
    w_count = {w: 0 for w in t}
    for w in t:
        w_count[w] += 1

    while True:
        if contains_all(letter_count, w_count):
            if right - left < min_window_size:
                min_left, min_right = left, right
                min_window_size = right - left
            letter_count[s[left]] -= 1
            left += 1
        elif right < n:
            letter_count[s[right]] += 1
            right += 1
        else:
            break

    return s[min_left:min_right]


def contains_all(letter_count, w_count):
    return all([letter_count[w] >= w_count[w] for w in w_count.keys()])


@pytest.mark.parametrize('s, t, expected', [
    ('ABC', 'XYZ', ''),
    ('ABCD', 'ABCD', 'ABCD'),
    ('ABCD', 'BC', 'BC'),
    ('ADOBECODEBANC', 'ABC', 'BANC'),
    ('A', 'AA', ''),
])
def test_min_window(s, t, expected):
    actual = min_window(s, t)
    assert expected == actual


if __name__ == '__main__':
    pytest.main([__file__])


